const apiKey="62ff9f9c-5230-4693-9a74-905b2a051460";async function searchContents(e){const t=await fetch("https://prod.operand.ai/v3/search/objects",{method:"POST",headers:{'Content-Type':"application/json",Authorization:apiKey},body:JSON.stringify({query:e,max:10})});return await t.json()}function debounce(t,n=200){let e;return(...s)=>{clearTimeout(e),e=setTimeout(()=>{t.apply(this,s)},n)}}registerHandlers(debounce(e=>{term=e.target.value,term!==""&&searchContents(term).then(e=>e.results.map(e=>({url:e.object.properties.url,content:e.snippet,title:e.object.metadata.title}))).then(e=>displayResults(e))}))